import React from "react";
import ReactDOM from "react-dom";
import './index.css'


const fname="Harshali";
const img1 ="https://picsum.photos/id/1/200/300";
const img2 ="https://picsum.photos/id/1/250/300";
const img3 ="https://picsum.photos/id/1/300/300";
const link="https://www.flipkart.com/";
const head={
  textAlign: 'center',
  color:'blue',
  textTransform: 'capitalize',
  margin: '70px',
  fontFamily: "'Lobster', cursive",
  margin: '70px 0'
}


ReactDOM.render(
 <React.Fragment>
    <h1 style={head}> My name is {fname}</h1> 
    <div className="img_div">
   <img src={img1}/>
   <img src={img2}/>
   <a href={link} target="_harshali">

   <img src={img3} />
   </a>
   </div>


 </React.Fragment>
 ,document.getElementById('root'));
